import React from "react";
import SchoolsMap from "../components/Maps/SchoolsMap";

export default function TestMapPage() {
    const schools = [
        { id: 1, name: "Haifa", lat: 32.794, lng: 34.989 },
        { id: 2, name: "Tel Aviv", lat: 32.0853, lng: 34.7818 },
    ];

    const apiKey =
        process.env.REACT_APP_MAPS_API_KEY || import.meta?.env?.VITE_MAPS_API_KEY;

    return (
        <div style={{ height: "100vh", width: "100vw" }}>
            <SchoolsMap apiKey={apiKey} schools={schools} />
        </div>
    );
}
